import React from "react";

function HeaderLogo() {
  return (
    <div className="header-logo">
      <img
        src="../images/catalunya-outline-map.png"
        alt="catalunya-outline-map"
        height="100px"
        width="100px"
      />
    </div>
  );
}

export default HeaderLogo;
